'''
        Example 1:

        Input: nums = [10,5,2,6], k = 100
        Output: 8
        Explanation: The 8 subarrays that have product less than 100 are:
        [10], [5], [2], [6], [10, 5], [5, 2], [2, 6], [5, 2, 6]
        Note that [10, 5, 2] is not included as the product of 100 is not strictly less than k.

        Example 2:

        Input: nums = [1,2,3], k = 0
        Output: 0

    '''




from functools import reduce
from typing import List
def numSubarrayProductLessThanK2(nums: List[int], k: int) -> int:
    ft = list(filter(lambda x: x < k, nums))
    if len(ft) == 0:
        return 0
    c = 0
    for sl in sublists(ft):
        c += 1 if reduce((lambda x, y: x * y), sl) < k else 0
    return c


def sublists(lst):
    return [lst[i:j] for i in range(len(lst)) for j in range(i + 1, len(lst) + 1)]


def numSubarrayProductLessThanK(nums: List[int], k: int) -> int:
    if k <= 1:  # Handle invalid case
        return 0

    window_start = 0
    product = 1
    count = 0

    for window_end in range(len(nums)):
        product *= nums[window_end]

        while product >= k:
            product //= nums[window_start]
            window_start += 1

        count += window_end - window_start + 1

    return count


